import { Component } from "react";
import Button from "./Button";

const styles = {
	cartBike: {
		display: 'flex',
		alignItems: 'center',
		justifyContent: 'space-between',
		position: 'relative'
	},
	time: {
		display: 'flex',
		alignItems: 'center',
		justifyContent: 'space-between',
	}
}

class CartBike extends Component {
	render(){
		const { deleteBike, cartBike } = this.props
		return(
			<div>
				{/*cartBike.isCartInBike?(cartBike.time)(cartBike.quantity)
				:<Button onClick={()=>deleteBike(cartBike)}>Delete</Button>*/}
				{cartBike.isBikeInCart?<div style={styles.cartBike}><h4>{cartBike.time}</h4><h3>{cartBike.quantity}</h3><h5>{cartBike.price}</h5></div>
				: null}
				{cartBike.isBikeInCart?<Button onClick={()=>deleteBike(cartBike)}>Delete</Button>:null}
			</div>
		)
	}
}

export default CartBike
